import React from 'react';
import '../styles/NewsUpdates.module.css';

const NewsUpdates = () => {
  return (
    <div className="news-updates">
      <h3>News Updates</h3>
      <ul>
        <li>Road Closure - Aug 18</li>
        <li>New Park Opening - Aug 30</li>
      </ul>
    </div>
  );
};

export default NewsUpdates;
